Technically I have expert skills in HTML, CSS and JavaScript, and a deep understading of both desktop and mobile platforms. I'm highly experienced using PHP, with knowledge of many popular frameworks and CMS systems, and also developing OOP systems from scratch. I have experience using Ruby (Rails), some iOS development work in Objective C (love to work more with), and server-side JavaScript in node.js.

